import numpy as np
import pandas as pd
import argparse
from rdkit import Chem
from rdkit.Chem import AllChem
import pickle


def save_obj(obj, name):
    with open('obj/' + name + '.pkl', 'wb') as f:
        pickle.dump(obj, f, pickle.HIGHEST_PROTOCOL)


def load_obj(name):
    with open('obj/' + name + '.pkl', 'rb') as f:
        return pickle.load(f)


validation_split = .1
shuffle_dataset = True
random_seed = 42
parser = argparse.ArgumentParser()
parser.add_argument("--dataset", help="dataset to train", default='descriptor')
parser.add_argument("--solubility", help="dataset to train", default='delaney')
args = parser.parse_args()
dataset = args.dataset
solubility = args.solubility

delaney = pd.read_csv("delaney.csv", skiprows=1,
                      names=['id', 'measured', 'predicted', 'SMILES'])
descriptor = pd.read_csv(dataset + ".csv")
descriptor['Solubility'] = delaney['measured']
descriptor['SMILES'] = delaney['SMILES']

# Creating data indices for training and validation splits:
dataset_size = len(descriptor)
print('dataset_size= %s' % (dataset_size))
indices = list(range(dataset_size))
split = int(np.floor(validation_split * dataset_size))
if shuffle_dataset:
    np.random.seed(random_seed)
    np.random.shuffle(indices)
train_indices, val_indices = indices[split:], indices[:split]
# print(train_indices)

# Creating PT data samplers and loaders:
train_sampler = descriptor.loc[train_indices]
train_sampler.to_csv('train_smi.csv', index=False)
train_sampler['SMILES'] = 0
train_mean = train_sampler.mean()
train_std = train_sampler.std()
train_sampler = (
    train_sampler - train_mean) / train_std

valid_sampler = descriptor.loc[val_indices]
valid_sampler.to_csv('val_smi.csv', index=False)
valid_sampler['SMILES'] = 0
valid_sampler = (valid_sampler-train_mean)/train_std

mean_std = {}
mean_std['mean'] = train_mean
mean_std['std'] = train_std

save_obj(mean_std, 'mean_std')


